CREATE TYPE pattern_type AS ENUM ('svg', 'base64');

CREATE TABLE IF NOT EXISTS skin_colors (
	id SERIAL PRIMARY KEY,
	color VARCHAR (9) UNIQUE NOT NULL
);

CREATE TABLE IF NOT EXISTS skin_patterns (
	id SERIAL PRIMARY KEY,
	source TEXT UNIQUE NOT NULL,
	type pattern_type
);

CREATE TABLE IF NOT EXISTS account_skin (
	id SERIAL PRIMARY KEY,
	account INT UNIQUE REFERENCES accounts(id),
	color INT REFERENCES skin_colors(id),
	pattern INT REFERENCES skin_patterns(id)
);


